pragma solidity ^0.8.6;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "./Initializers.sol";

contract InitializerMinter {

    address public owner;
    address public recipient;

    Initializers public initializers = Initializers(0x881D9c2F229323aad28a9c9045111e30e1F1eB25);

    constructor(address _owner, address _recipient) {
        owner = _owner;
        recipient = _recipient;
    }

    function mint(uint8 maxMint) public {
        uint remaining = initializers.reserveSupplyAvailable();

        if(remaining > maxMint){
            remaining = maxMint;
        }

        while(remaining > 0){
            initializers.reserveMint(recipient);
            unchecked{
                remaining--;
            }
        }
        initializers.transferOwnership(owner);
    }

    function recover() public {
        require(msg.sender == owner || msg.sender == recipient);
        initializers.transferOwnership(owner);
    }

}
